 "use strict";

 (function ($) {

 $.vifiballocable = function(options) {
 return $.ajax($.extend({
 type: 'GET',
 async: false,
 contentType: 'application/json',
 data: {
 slave: options.slave,
 software_release: options.software_release,
 software_type: options.software_type,
 sla: JSON.stringify(options.sla)},
 }, options));
 };

 }(jQuery));
